, [-35.63352966308594, -153.56161499023438, 36.18114471435547], [-30.445396423339844, -202.7980499267578, 40.762210845947266], [64.47663116455078, -202.09967041015625, 4.123157501220703], [-91.78697967529297, -159.0240478515625, 74.8120346069336], [-44.58015441894531, -209.9464111328125, 30.066837310791016], [32.70658493041992, -252.0803680419922, 66.50098419189453], [69.0450439453125, -162.5326385498047, -25.67413330078125], [-13.815521240234375, -159.1697998046875, -12.3209228515625], [64.24349975585938, -159.45188903808594, 9.225471496582031], [3.669431686401367, -149.24530029296875, -14.712574005126953], [-73.66416931152344, -164.44442749023438, -9.219596862792969], [52.40888977050781, -174.95794677734375, -7.876411437988281], [-107.87042236328125, -235.6299285888672, 75.89840698242188], [51.32162094116211, -223.8966522216797, 56.31508255004883], [-35.91480255126953, -185.2349395751953, -29.848403930664062], [-2.8862266540527344, -182.5026092529297, 48.610225677490234], [-20.211212158203125, -199.33740234375, -131.05743408203125], [-25.197032928466797, -188.4293670654297, 72.99958801269531], [-51.54473114013672, -178.58419799804688, -54.971046447753906], [-24.210330963134766, -142.74765014648438, 41.309146881103516], [-73.32302856445312, -212.73538208007812, 20.73302459716797], [48.32281494140625, -215.18548583984375, 64.7695083618164], [-11.454856872558594, -189.80763244628906, -153.23980712890625], [24.402746200561523, -142.21572875976562, 44.08495330810547]], "in_top10": true, "has_gt": false, "status": "fake", "color": "#cc0000", "euc_rank": 9, "euc_dist": 253.09027099609375, "gt_count": 0, "gap": 108.44270324707031, "radii": [77.3306686928681, 92.09914058320881, 115.5040789380265], "eigenvectors": [[0.22103335617289507, 0.9707575978249764, 0.09366932114639903], [0.9633159061156931, -0.20232626165558742, -0.17631377957770425], [0.15220617754692725, -0.12920437341497334, 0.9798670876231107]]}];

        let showPoints = true;
        let showEllipsoids = false;

        function createPlot() {
            const traces = [];

            // Query point
            traces.push({
                x: [queryPoint[0]],
                y: [queryPoint[1]],
                z: [queryPoint[2]],
                mode: 'markers',
                type: 'scatter3d',
                name: 'Query',
                marker: {
                    size: 12,
                    color: '#0066ff',
                    symbol: 'diamond',
                    line: { color: '#fff', width: 2 }
                },
                hovertemplate: '<b>QUERY</b><extra></extra>'
            });

            // GT points
            traces.push({
                x: gtPoints.map(p => p[0]),
                y: gtPoints.map(p => p[1]),
                z: gtPoints.map(p => p[2]),
                mode: 'markers+text',
                type: 'scatter3d',
                name: 'GT Neighbors',
                marker: {
                    size: 8,
                    color: '#00ff88',
                    symbol: 'square',
                    line: { color: '#000', width: 1 }
                },
                text: gtInfo.map(g => g.rank.toString()),
                textposition: 'top center',
                textfont: { size: 10, color: '#fff' },
                hovertemplate: gtInfo.map(g => 
                    `<b>GT #${g.rank}</b><br>ID: ${g.id}<br>Cluster: ${g.cluster}<extra></extra>`
                )
            });

            // Lines from query to GT
            gtPoints.forEach((gt, i) => {
                traces.push({
                    x: [queryPoint[0], gt[0]],
                    y: [queryPoint[1], gt[1]],
                    z: [queryPoint[2], gt[2]],
                    mode: 'lines',
                    type: 'scatter3d',
                    name: '',
                    showlegend: false,
                    line: { color: 'rgba(0, 255, 136, 0.3)', width: 1 },
                    hoverinfo: 'skip'
                });
            });

            // Clusters
            clusters.forEach(cluster => {
                // Cluster points
                if (showPoints) {
                    traces.push({
                        x: cluster.points.map(p => p[0]),
                        y: cluster.points.map(p => p[1]),
                        z: cluster.points.map(p => p[2]),
                        mode: 'markers',
                        type: 'scatter3d',
                        name: `C${cluster.cid} points`,
                        visible: showPoints ? true : 'legendonly',
                        marker: {
                            size: 2,
                            color: cluster.color,
                            opacity: 0.4
                        },
                        hovertemplate: `Cluster ${cluster.cid}<extra></extra>`
                    });
                }

                // Centroid
                traces.push({
                    x: [cluster.centroid[0]],
                    y: [cluster.centroid[1]],
                    z: [cluster.centroid[2]],
                    mode: 'markers+text',
                    type: 'scatter3d',
                    name: `C${cluster.cid} centroid`,
                    marker: {
                        size: 10,
                        color: cluster.color,
                        symbol: 'x',
                        line: { color: '#fff', width: 1 }
                    },
                    text: [`C${cluster.cid}`],
                    textposition: 'top center',
                    textfont: { size: 10, color: '#fff' },
                    hovertemplate: `<b>Cluster ${cluster.cid}</b><br>` +
                        `Status: ${cluster.status.toUpperCase()}<br>` +
                        `Rank: ${cluster.euc_rank}<br>` +
                        `Distance: ${cluster.euc_dist.toFixed(1)}<br>` +
                        `GT Count: ${cluster.gt_count}<br>` +
                        `Gap: ${cluster.gap.toFixed(1)}<extra></extra>`
                });

                // Line from query to centroid
                traces.push({
                    x: [queryPoint[0], cluster.centroid[0]],
                    y: [queryPoint[1], cluster.centroid[1]],
                    z: [queryPoint[2], cluster.centroid[2]],
                    mode: 'lines',
                    type: 'scatter3d',
                    name: '',
                    showlegend: false,
                    line: {
                        color: cluster.color,
                        width: 2,
                        dash: 'dash'
                    },
                    hoverinfo: 'skip'
                });

                // Ellipsoid surface (approximate with mesh)
                if (showEllipsoids) {
                    const ellipsoidTrace = createEllipsoid(
                        cluster.centroid, 
                        cluster.radii, 
                        cluster.eigenvectors,
                        cluster.color
                    );
                    traces.push(ellipsoidTrace);
                }
            });

            const layout = {
                scene: {
                    xaxis: { title: 'PC1', gridcolor: '#333', zerolinecolor: '#555' },
                    yaxis: { title: 'PC2', gridcolor: '#333', zerolinecolor: '#555' },
                    zaxis: { title: 'PC3', gridcolor: '#333', zerolinecolor: '#555' },
                    bgcolor: '#0a0a15',
                    camera: {
                        eye: { x: 1.5, y: 1.5, z: 1.5 }
                    }
                },
                paper_bgcolor: '#0a0a15',
                plot_bgcolor: '#0a0a15',
                font: { color: '#eee' },
                showlegend: false,
                margin: { l: 0, r: 0, t: 0, b: 0 }
            };

            Plotly.newPlot('plot3d', traces, layout, { responsive: true });
        }

        function createEllipsoid(center, radii, eigenvectors, color) {
            const n = 20;
            const u = [];
            const v = [];
            for (let i = 0; i <= n; i++) {
                u.push(i * Math.PI / n);
            }
            for (let j = 0; j <= n; j++) {
                v.push(j * 2 * Math.PI / n);
            }

            const x = [], y = [], z = [];
            for (let i = 0; i < u.length; i++) {
                const xRow = [], yRow = [], zRow = [];
                for (let j = 0; j < v.length; j++) {
                    const px = radii[0] * Math.sin(u[i]) * Math.cos(v[j]);
                    const py = radii[1] * Math.sin(u[i]) * Math.sin(v[j]);
                    const pz = radii[2] * Math.cos(u[i]);

                    // Rotate by eigenvectors
                    const rx = eigenvectors[0][0]*px + eigenvectors[0][1]*py + eigenvectors[0][2]*pz;
                    const ry = eigenvectors[1][0]*px + eigenvectors[1][1]*py + eigenvectors[1][2]*pz;
                    const rz = eigenvectors[2][0]*px + eigenvectors[2][1]*py + eigenvectors[2][2]*pz;

                    xRow.push(center[0] + rx);
                    yRow.push(center[1] + ry);
                    zRow.push(center[2] + rz);
                }
                x.push(xRow);
                y.push(yRow);
                z.push(zRow);
            }

            return {
                type: 'surface',
                x: x,
                y: y,
                z: z,
                opacity: 0.3,
                colorscale: [[0, color], [1, color]],
                showscale: false,
                hoverinfo: 'skip'
            };
        }

        function togglePoints(show) {
            showPoints = show;
            document.querySelectorAll('.control-btn').forEach(btn => btn.classList.remove('active'));
            event.target.classList.add('active');
            createPlot();
        }

        function toggleEllipsoids(show) {
            showEllipsoids = show;
            createPlot();
        }

        function resetCamera() {
            Plotly.relayout('plot3d', {
                'scene.camera': { eye: { x: 1.5, y: 1.5, z: 1.5 } }
            });
        }

        function focusCluster(cid) {
            const cluster = clusters.find(c => c.cid === cid);
            if (cluster) {
                Plotly.relayout('plot3d', {
                    'scene.camera': {
                        eye: {
                            x: cluster.centroid[0] / 50 + 1,
                            y: cluster.centroid[1] / 50 + 1,
                            z: cluster.centroid[2] / 50 + 1
                        },
                        center: {
                            x: cluster.centroid[0] / 100,
                            y: cluster.centroid[1] / 100,
                            z: cluster.centroid[2] / 100
                        }
                    }
                });
            }
        }

        // Populate sidebar
        function populateSidebar() {
            const clusterList = document.getElementById('cluster-list');
            const sortedClusters = [...clusters].sort((a, b) => a.euc_rank - b.euc_rank);

            sortedClusters.forEach(cluster => {
                const card = document.createElement('div');
                card.className = `cluster-card ${cluster.status}`;
                card.onclick = () => focusCluster(cluster.cid);
                card.innerHTML = `
                    <div class="cluster-header">
                        <span class="cluster-name">Cluster ${cluster.cid}</span>
                        <span class="cluster-status ${cluster.status}">${cluster.status}</span>
                    </div>
                    <div class="cluster-details">
                        <span>Rank: ${cluster.euc_rank}</span>
                        <span>Dist: ${cluster.euc_dist.toFixed(1)}</span>
                        <span>GT: ${cluster.gt_count}</span>
                        <span>Gap: ${cluster.gap.toFixed(1)}</span>
                    </div>
                `;
                clusterList.appendChild(card);
            });

            const gtList = document.getElementById('gt-list');
            gtInfo.forEach((gt, i) => {
                const item = document.createElement('div');
                item.className = 'gt-item';
                const inTop10 = clusters.some(c => c.cid === gt.cluster && c.in_top10);
                item.innerHTML = `
                    <span>#${gt.rank} (ID: ${gt.id})</span>
                    <span>C${gt.cluster} ${inTop10 ? '✓' : '✗'}</span>
                `;
                gtList.appendChild(item);
            });
        }

        // Initialize
        createPlot();
        populateSidebar();
    </script>
